REPOST! Thank you for hosting us @carolinebrackettdesign 💛😘 I always have the best time with you ladies
.
.
Thinking back to one week ago when I had the honor of hostessing this amazingly talented group of ladies in Greenville and at Midway for our HIVE (as we refer to ourselves) retreat.

We all met almost 4 years ago at another work retreat in Colorado. Since then, we have gotten together twice a year to discuss all things related to running an interior design firm. We are from all parts of the country and take turns hostessing each time. I am so thankful that my turn was up and that I got to show them my little @midway.farm world. 

We have become SUCH great friends and sisters in the industry in that time. We inspire, cheer for, lean on, support, and learn from each other with zero competition. I for one know that my business operates better and my clients are happier because of all I have gleaned from them. 

Our days were filled with meetings, strategizing, and brainstorming, followed by afternoons and evenings of skeet shooting, target practice, playing with all the animals (most notably baby donkey Moses, of course), yoga, delicious food and drink, ATV riding, SO much laughter, fireside chats, and a magical sunset dinner at the top of the Sunflower field. Midway is magical and good for the soul, and I'm so thankful that I could share it with my HIVE. 

Serena Williams said it best...."Every woman's success should be an inspiration to another, we're strongest when we cheer each other on." Amen. 

